import React, { Component } from 'react';
import Nav from '../../components/Nav/nav'
import { Parallax} from 'react-parallax';
import './res.css'
class Res extends Component {

	render() {
		return (
            <div>
            <Nav></Nav>

     <Parallax
      blur={3}
      bgImage={require('../../Picutres/res-learnmore-2.jpg')}
      bgImageAlt="Solar1"
      strength={100}
    >


      <div style={{ height: '300px' }} />
    </Parallax>



                </div>
		);
	}
}
export default Res;
